import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import Paper from '@material-ui/core/Paper';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import { createMuiTheme, ThemeProvider } from '@material-ui/core/styles'
const theme = createMuiTheme({
  direction: 'rtl', // Both here and <body dir="rtl">
});

const useStyles = makeStyles({
  table: {
    position:'absolute',
    top:100,
    left:50,
    align:'right',
    maxWidth: 340,
    marginTop:30,
    paddingTop:30,
   
  },
  paper:{
    maxWidth: 350,
    marginTop:30,
  }
});

function createData(name, calories, ) {
  return { name, calories,  };
}

const rows = [
  createData('12:54', 'תפילת שחרית', ),
  createData('תפילת מנחה ויום כיפור','תפילת מוסף םלםגכם כםלכםכלכם'),
  createData('Eclair', 262, ),
  createData('Cupcake', 305,),
  createData('Gingerbread', 356, ),
  createData('Frozen yoghurt', 159, ),
  createData('Ice cream sandwich', 237,),
  createData('Eclair', 262, ),
  createData('Cupcake', 305,),
  createData('Gingerbread', 356, ),
  createData('Frozen yoghurt', 159, ),
  createData('Ice cream sandwich', 237,),
  createData('Eclair', 262, ),
  createData('Cupcake', 305,),
  createData('Gingerbread', 356, ),
];

export default function PrayerHours() {
  const classes = useStyles();

  return (
    <ThemeProvider theme={theme}>
    <Paper className={classes.paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
          
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.name} dir="rtl">
              <TableCell dir='rtl' component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell dir="rtl" style={{dir:"rtl",}}>{row.calories}</TableCell>
   
            
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </Paper>
    </ThemeProvider>
  );
}
